function Java(props){
    const {o,p,i,u,y}=props
    return(
        <div>
          <p>Name:{o}</p>
          <p>Age:{p}</p>
          <p>State:{i}</p>
          <p>City:{u}</p>
          <p>Mobile:{y}</p>
        </div>
    )
}

export default Java;
